import React from 'react';
import './index.css';
import Cards from './cards';
import Api from './api';

const App = () => {
    return (
        <>
         <h1>Hotel Rooms</h1>
          {Api.map((values)=>{
              return(
                  <>
                <Cards 
                  src={values.src}
                  text={values.text}
                  title={values.title}

                />

                  </>
              )
          })}
          
        </>
    )
};

export default App;
